import React, { Component} from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: 'original'
    }
  }

  componentDidMount() {
    this.fetch('/')
      .then(res => res.json())
      .then(title => this.setState({title}))
  }

  render() { 
    console.log(this.state.title);
    return (
      <div>
        {this.state.title}
      </div>
    );
  }
}

export default App;
